      size: default
      orientation: portrait
      plt_kind: bar
      title: Long Term Currents
      grid: True
      legend: False
      legend_location: best
      marker: NULL
      x: [file_index]
      y: [percent_damage]
      label: [Damage Percentage]
      #      xlim: [0.0000001, 1]
      xlabel: Profile
      ylabel: Damage Contribution (%)
      x_reverse: False
      y_reverse: False

